import React from 'react';
import './TimelineStyles.css';

const internships = [
  {
    title: 'Software Developer Intern - Smart Desert Pvt Ltd',
    duration: 'Jul 2021 – Dec 2021',
    description:
      'Designed wireframes and mockups for the \"Excelli Super App\" using Figma. Translated user needs into responsive HTML/CSS/JavaScript front-end components. Ensured code quality via documentation and reviews.',
  },
  {
    title: 'Teaching Assistant - SUNY New Paltz',
    duration: 'Jan 2024 – May 2024',
    description:
      'Built an AI-powered grading site using Node.js, SQL, ChatBot API, and React. Improved grading speed by 80% and managed Tableau/Power BI reporting.',
  },
];

const InternshipSection = () => (
  <section id="internships" className="timeline-section">
    <h2 className="timeline-title">My Internships</h2>
    {internships.map((item, index) => (
      <div key={index} className="timeline-card">
        <h3>{item.title}</h3>
        <p className="timeline-duration">{item.duration}</p>
        <p>{item.description}</p>
      </div>
    ))}
  </section>
);

export default InternshipSection;
